import * as React from 'react';
import Avatar from '@mui/material/Avatar';
import { Typography } from '@mui/material';
import Box from '@mui/material/Box';
import EmailOutlinedIcon from '@mui/icons-material/EmailOutlined';
import Link from '@mui/material/Link';

export default function Profile () {
  return (
      <Box sx={{
        display: 'flex',
        flexDirection: 'column',
        alignItems: 'center',
        textAlign: 'center',
        bgcolor: 'black',
        borderRadius: 5,
        color: 'white',
        }}>
          <Box> 
            <Avatar
            alt="Foto de Perfil do João"
            src="https://avatars.githubusercontent.com/u/81587343?v=4"
            sx={{ marginTop: 3, width: 200, height: 200 }} />
            <Typography sx={{marginTop: 3}} component="h1" variant="h5">
                João Victor Martins
            </Typography>
            <Typography sx={{marginTop: 3, bgcolor:'#605966', borderRadius:2, padding: '5px 10px 5px 10px',}} component="h1" variant="subtitle1">
              Web Developer
            </Typography>
          </Box>
      
          <Box sx={{marginTop: 3, display:'flex', justifyItems:'start', textAlign:'left', alignItems:'center' }}>
            <EmailOutlinedIcon sx={{width: 50, height: 50}}></EmailOutlinedIcon>
            <Box sx={{display:'flex', flexDirection:'column'}}>
              <Typography variant="subtitle2">Email</Typography>
              <Link href="mailto:joaolerner@outlook.com.br">joaolerner@outlook.com.br</Link>
            </Box>
          </Box>
      </Box>
 
     
  );
}
